import React, { useState, useContext } from "react";
import {
  Box,
  Typography,
  TextField,
  Button,
  Autocomplete,
  useTheme,
} from "@mui/material";
import { auth } from "../firebase";

function AddMaintenance({ onAdd }) {
  const theme = useTheme(); // access current theme mode
  const [serviceType, setServiceType] = useState("");
  const [mileage, setMileage] = useState("");
  const [date, setDate] = useState(new Date().toISOString().split("T")[0]);

  const maintenanceOptions = [
    "Oil Change",
    "Brake Pads",
    "Tire Rotation",
    "Battery Replacement",
    "Spark Plugs",
    "Coolant Flush",
    "Transmission Fluid",
    "Cabin Air Filter",
    "Inspection",
    "Alignment",
    "Tire Change",
    "Power Steering Fluid",
    "Serpentine Belt",
    "Wiper Blades",
    "Brake Fluid",
    "Engine Replacement",
    "Transmission Replacement",
    "Brake Caliper Replacement",
    "Strut Replacement",
    "Wheel Balance",
    "Alternator Replacement",
    "Engine Air Filter Replacement",
    "Headlight Bulb Replacement",
    "Windshield Crack Repair",
    "Windshield Replacement",
    "Custom...",
  ];

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!serviceType || !mileage || !date) return;

    const user = auth.currentUser;
    if (!user) {
      console.error("User is not logged in");
      return;
    }

    const idToken = await user.getIdToken();

    try {
      const response = await fetch("http://127.0.0.1:5000/add_record", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `${idToken}`,
        },
        body: JSON.stringify({
          serviceType,
          mileage,
          date,
        }),
      });

      if (!response.ok) throw new Error("Failed to add record");
      const data = await response.json();
      console.log("Added record:", data);
      window.location.reload();
      setServiceType("");
      setMileage("");
      setDate(new Date().toISOString().split("T")[0]);
    } catch (error) {
      console.error("Error:", error);
    }
  };

  return (
    <Box
      sx={{
        maxWidth: "600px",
        margin: "auto",
        marginTop: "20px",
        padding: "20px",
        borderRadius: "8px",
        backgroundColor: theme.palette.background.default,
        boxShadow: theme.palette.mode === "dark" ? "0 0 10px #222" : "0 0 10px #ccc",
      }}
    >
      <Typography variant="h6" fontWeight="bold" gutterBottom>
        Add Maintenance Record
      </Typography>
      <form onSubmit={handleSubmit}>
        <Autocomplete
          freeSolo
          fullWidth
          options={maintenanceOptions}
          value={serviceType}
          onChange={(event, newValue) => setServiceType(newValue)}
          renderInput={(params) => (
            <TextField
              {...params}
              label="Service Type"
              variant="outlined"
              required
              margin="normal"
              sx={{
                input: {
                  backgroundColor: theme.palette.mode === "dark" ? "#2c2c2c" : "#fff",
                  color: theme.palette.text.primary,
                },
              }}
            />
          )}
        />
        <TextField
          fullWidth
          label="Mileage"
          type="number"
          value={mileage}
          onChange={(e) => setMileage(e.target.value)}
          inputProps={{ min: 0, max: 1000000 }}
          variant="outlined"
          required
          margin="normal"
          sx={{
            input: {
              backgroundColor: theme.palette.mode === "dark" ? "#2c2c2c" : "#fff",
              color: theme.palette.text.primary,
            },
          }}
        />
        <TextField
          fullWidth
          label="Date"
          type="date"
          value={date}
          onChange={(e) => setDate(e.target.value)}
          InputLabelProps={{ shrink: true }}
          inputProps={{ max: new Date().toISOString().split("T")[0] }}
          variant="outlined"
          required
          margin="normal"
          sx={{
            input: {
              backgroundColor: theme.palette.mode === "dark" ? "#2c2c2c" : "#fff",
              color: theme.palette.text.primary,
            },
          }}
        />
        <Button
          fullWidth
          type="submit"
          variant="contained"
          color="primary"
          sx={{ marginTop: "16px" }}
        >
          Add Record
        </Button>
      </form>
    </Box>
  );
}

export default AddMaintenance;
